import React, { Component } from 'react'
import { DarkTheme, LightTheme } from './components/SettingsPanel';

export default class Button extends Component {


    constructor() {
       super();

       this.state = {
         clicked: false
       };

       this.handleClick = this.handleClick.bind(this);
     }

    handleClick() {
      this.setState({
        clicked: true
      });
    }

    render () {

      return (


              <DarkTheme onClick={this.handleClick}>

            {this.state.clicked ? <LightTheme /> : null }
            </DarkTheme>

    )



    }
  }
